  `usuario` varchar(20) NOT NULL,
  `contrasena` varchar(30) DEFAULT NULL,
  `nombre` varchar(50) DEFAULT NULL,
  `correo` varchar(30) DEFAULT NULL,
  `paisOrigen` varchar(20) DEFAULT NULL,
  `necesidadesEspecialesEducacion` enum('si','no') DEFAULT NULL,
  `genero` enum('Masculino','Femenino','Otro') DEFAULT NULL,
  `estadoCivil` enum('Soltero','Casado','Divorciado','Viudo','Union libre') DEFAULT NULL,
  `prestamo` enum('si','no') DEFAULT NULL,
  `beca` enum('si','no') DEFAULT NULL,
  `desplazado` enum('si','no') DEFAULT NULL,
  `totalCreditos` int(11) DEFAULT NULL,
  PRIMARY KEY (`usuario`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
